webpackJsonp([2453230436503],{337:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Allie & Derek's Wedding Site",subtitle:"June 16th, 2018 - Bath, Ohio",copyright:"© All rights reserved.",email:"contact@alliederek.com",menu:[{label:"Home",path:"/"},{label:"Where?",path:"/where/"},{label:"When?",path:"/when/"},{label:"Accomodations",path:"/accomodations/"}]}},markdownRemark:{id:"C:/Users/dereks/Desktop/allie-derek/src/pages/pages/2018-01-23--where/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-24add.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 77.16012084592144%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Hale Farm"\n        title=""\n        src="/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-d564d.jpg"\n        srcset="/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-865fd.jpg 240w,\n/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-d40a0.jpg 480w,\n/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-d564d.jpg 960w,\n/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-c67c1.jpg 1440w,\n/static/hale-farm-barn-5ff3f67ef6ff3de96ab2eb083fcda0f7-24add.jpg 1655w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>We’ll be having both our ceremony and reception at <strong>Hale Farm &#x26; Village</strong> in <strong>Bath, Ohio</strong>.</p>\n<p>The ceremony <img class="emoji-icon" data-icon="emoji-ring" style="display: inline; margin: 0; margin-top: 1px; position: relative; top: 5px; width: 25px" src="data:image/png;base64, "> will take place outside in the apple <img class="emoji-icon" data-icon="emoji-apple" style="display: inline; margin: 0; margin-top: 1px; position: relative; top: 5px; width: 25px" src="data:image/png;base64, "> orchard, and we’ll have the reception inside at the gatehouse. The two locations are within walking distance of each other.</p>\n<p>You can find more out about Hale Farm at the <a href="https://www.wrhs.org/plan-your-visit/hale-farm/">website</a></p>\n<h3>What?! That’s not Cleveland!!</h3>\n<p>Oh you know us too well. We love Cleveland, and yes, its a bit surprising that we aren’t hosting our shindig in the forest city, but Hale Farm is only a 30 minute drive south of Cleveland!</p>\n<p>Although we wouldn’t trade our city living for anything in the world, we love spending our weekends running <img class="emoji-icon" data-icon="emoji-running" style="display: inline; margin: 0; margin-top: 1px; position: relative; top: 5px; width: 25px" src="data:image/png;base64, "> and biking <img class="emoji-icon" data-icon="emoji-bike" style="display: inline; margin: 0; margin-top: 1px; position: relative; top: 5px; width: 25px" src="data:image/png;base64, "> in Cleveland’s parks. Hale Farm is located within biking distance of one our favorites, the <a href="https://www.nps.gov/cuva/index.htm">Cuyahoga National Park</a> and more specifically, <a href="https://www.nps.gov/cuva/planyourvisit/ohio-and-erie-canal-towpath-trail.htm">the Ohio &#x26; Erie Canal Towpath</a>.</p>',frontmatter:{title:"Where?",date:null,description:null}}},pathContext:{slug:"/where"}}}});
